create procedure [app].[cita_del]
@int_nroCita varchar(6)
as
begin

update grl_cita set int_estado=0 where int_nroCita=@int_nroCita

end
GO





create procedure [app].[cita_get]
@int_nroCita varchar(16),
@vhr_usuEmail varchar(32)
as
begin

insert into grl_citaLog(int_nroCita, vhr_usuEmail)
values(@int_nroCita, @vhr_usuEmail)

select 
	A.int_nroCita, A.dtt_FechaProgramacion, 
	A.chr_codBl, B.wchr_serie_ctn, B.wchr_nro_ctn, B.wchr_tipo_ctn,	B.wint_size_ctn,
	C.vch_ClieSocial, D.vhr_descripcion, 
	E.vch_VehiPlaca, F.vch_ChofBrevete, F.vch_ChofNombre, 
	G.vhr_desAlmacen, 
	H.chr_codCort as vhr_tipoCarga,
	convert(varchar(20), A.dtt_FechaArribo,20)  as dtt_FechaArribo, 
	convert(varchar(20), A.dtt_FechaIngreso,20)  as dtt_FechaIngreso, 
	convert(varchar(20), A.dtt_FechaSalida,20)  as dtt_FechaSalida,
	A.vhr_codBarra,
	A.chr_codBl
from grl_cita as A
inner join grl_contenedor as B on (A.chr_contcargcodigo=B.wchr_contcargcodigo)
inner join grl_cliente as C on (A.chr_LinCodigo=C.chr_ClieCodigo)
inner  join  grl_citaTipo as D on (D.chr_idTipo=A.chr_idTipo)
inner join grl_vehiculo as E on (A.chr_VehiCodigo=E.chr_VehiCodigo)
inner join grl_chofer as F on (A.chr_ChofCodigo=F.chr_ChofCodigo)
inner join grl_almacen as G on (A.chr_codAlmacen=G.chr_codAlmacen)
inner join grl_cargatipo as H on (A.vhr_tipoCarga=H.chr_codCarga)
where A.int_nroCita=@int_nroCita and int_estado=1


end

GO








create procedure [app].[cita_ins]
	@chr_ClieCodigo char(6) NULL,
	@chr_contcargcodigo char(6) NULL,
	@vhr_codBarra varchar(32) NULL,
	@dtt_FechaProgramacion varchar(32),
	@vhr_tipoCarga char(2) NULL,
	@chr_codAlmacen char(2) NULL,
	@chr_idTipo char(2) NULL,
	@vhr_usuEmail varchar(256) NULL,
	@vhr_ChofBrevete varchar(256) NULL, 
	@vhr_vehiPlaca varchar(256) NULL,
	@vhr_obsCliente varchar(256) NULL,
	@chr_VehiCodigo char(6),
	@chr_ChofCodigo char(6),
	@chr_codBl varchar(256),
	@vhr_ChofNombre varchar(256),
	@vhr_usuToken varchar(256),
	@vhr_usuNombres varchar(256),
	@vhr_serieNroCtn varchar(16),
	@vhr_desCarga varchar(16),
	@vhr_desAlmacen varchar(16),
	@vhr_desTipo varchar(16) 
as
begin


if @chr_VehiCodigo=''
	set @chr_VehiCodigo=NULL


if @chr_ChofCodigo=''
	set @chr_ChofCodigo=NULL


if @chr_codBl=''
	set @chr_codBl=NULL

declare @int_nroCita int

set @int_nroCita=(select max(int_nroCita) from grl_cita)

set @int_nroCita=@int_nroCita+1


update grl_cita set int_estado=0 where vhr_codBarra=@vhr_codBarra

insert into grl_cita(int_nroCita,chr_ClieCodigo ,chr_contcargcodigo,vhr_codBarra ,dtt_FechaProgramacion,vhr_tipoCarga ,chr_codAlmacen ,chr_idTipo ,vhr_usuEmail,vhr_ChofBrevete,vhr_vehiPlaca,vhr_obsCliente,dtt_FechaRegistro,int_estado,chr_codUsuario, chr_VehiCodigo, chr_ChofCodigo, chr_codBl, vhr_ChofNombre, vhr_usuToken, vhr_usuNombres, vhr_serieNroCtn, vhr_desCarga, vhr_desAlmacen, vhr_desTipo)
		   values(@int_nroCita,@chr_ClieCodigo,@chr_contcargcodigo,@vhr_codBarra,@dtt_FechaProgramacion,@vhr_tipoCarga,@chr_codAlmacen,@chr_idTipo,@vhr_usuEmail,@vhr_ChofBrevete,@vhr_vehiPlaca,@vhr_obsCliente,getdate(),1,'0525', @chr_VehiCodigo, @chr_ChofCodigo, @chr_codBl, @vhr_ChofNombre, @vhr_usuToken,@vhr_usuNombres, @vhr_serieNroCtn, @vhr_desCarga, @vhr_desAlmacen, @vhr_desTipo)


-- se supondra que la linea del contenedor es ONE
-- esta linea es mas compleja: buscar el codigo de la linea naviera en base al numero del contenedor
--update grl_cita set chr_LinCodigo='027116' where int_nroCita=@int_nroCita and int_estado=1



--chr_ContEvenCodigo	vch_ContEvenDescripcion
--	32	Entrada lleno simple	01
--  29	Despacho llenado		02

update grl_cita set chr_ContEvenCodigo='32' where int_nroCita=@int_nroCita and int_estado=1 and chr_idTipo='01'
update grl_cita set chr_ContEvenCodigo='29' where int_nroCita=@int_nroCita and int_estado=1 and chr_idTipo='02'



--actualizar el codigo del chofer (si existe)



--set @chr_ChofCodigo=(select top 1 chr_ChofCodigo from grl_chofer where (vch_ChofBrevete=@vhr_ChofBrevete or chr_ChofDNI=@vhr_ChofBrevete))

--update grl_cita set chr_ChofCodigo=@chr_ChofCodigo where int_nroCita=@int_nroCita and int_estado=1


--actualizar codigo de vehiculo

--declare @chr_VehiCodigo char(6)

--set @chr_VehiCodigo=(select top 1 chr_VehiCodigo from grl_vehiculo where (vch_VehiPlaca=@vhr_vehiPlaca))

--update grl_cita set chr_VehiCodigo=@chr_VehiCodigo where int_nroCita=@int_nroCita and int_estado=1


--actualizar estado

update grl_cita set vhr_estado='Activo' where int_nroCita=@int_nroCita and int_estado=1


--actualizar el codigo de BL


declare @chr_LinCodigo char(6)

set @chr_LinCodigo=(select chr_LinCodigo from grl_documentoCliente where vch_numDoc=@chr_codBl)

update grl_cita set chr_LinCodigo=@chr_LinCodigo where int_nroCita=@int_nroCita and int_estado=1 


end


go









CREATE procedure [app].[cita_sel]
@vhr_codBarra varchar(256),
@int_nroCita int
as
begin

select 
	A.int_nroCita, A.dtt_FechaProgramacion, 
	A.chr_codBl, B.wchr_serie_ctn, B.wchr_nro_ctn, B.wchr_tipo_ctn,	B.wint_size_ctn,
	C.vch_ClieSocial, D.vhr_descripcion, 
	E.vch_VehiPlaca, F.vch_ChofBrevete, F.vch_ChofNombre, G.vhr_desAlmacen, A.vhr_tipoCarga,
	convert(varchar(20), A.dtt_FechaArribo,20)  as dtt_FechaArribo, 
	convert(varchar(20), A.dtt_FechaIngreso,20)  as dtt_FechaIngreso, 
	convert(varchar(20), A.dtt_FechaSalida,20)  as dtt_FechaSalida
from grl_cita as A
inner join grl_contenedor as B on (A.chr_contcargcodigo=B.wchr_contcargcodigo)
inner join grl_cliente as C on (A.chr_LinCodigo=C.chr_ClieCodigo)
inner  join  grl_citaTipo as D on (D.chr_idTipo=A.chr_idTipo)
inner join grl_vehiculo as E on (A.chr_VehiCodigo=E.chr_VehiCodigo)
inner join grl_chofer as F on (A.chr_ChofCodigo=F.chr_ChofCodigo)
inner join grl_almacen as G on (A.chr_codAlmacen=G.chr_codAlmacen)
where (A.vhr_codBarra=@vhr_codBarra) or (A.int_nroCita=@int_nroCita)

end

GO





CREATE procedure [app].[cita_sel2]
@vhr_usuEmail varchar(256)
as
begin

select 
	A.int_nroCita, A.dtt_FechaProgramacion, 
	A.chr_codBl, B.wchr_serie_ctn, B.wchr_nro_ctn, B.wchr_tipo_ctn,	B.wint_size_ctn,
	C.vch_ClieSocial, D.vhr_descripcion, 
	E.vch_VehiPlaca, F.vch_ChofBrevete, F.vch_ChofNombre, G.vhr_desAlmacen, A.vhr_tipoCarga,
	convert(varchar(20), A.dtt_FechaArribo,20)  as dtt_FechaArribo, 
	convert(varchar(20), A.dtt_FechaIngreso,20)  as dtt_FechaIngreso, 
	convert(varchar(20), A.dtt_FechaSalida,20)  as dtt_FechaSalida,
	A.vhr_codBarra
from grl_cita as A
inner join grl_contenedor as B on (A.chr_contcargcodigo=B.wchr_contcargcodigo)
inner join grl_cliente as C on (A.chr_LinCodigo=C.chr_ClieCodigo)
inner  join  grl_citaTipo as D on (D.chr_idTipo=A.chr_idTipo)
inner join grl_vehiculo as E on (A.chr_VehiCodigo=E.chr_VehiCodigo)
inner join grl_chofer as F on (A.chr_ChofCodigo=F.chr_ChofCodigo)
inner join grl_almacen as G on (A.chr_codAlmacen=G.chr_codAlmacen)
where A.vhr_usuEmail=@vhr_usuEmail
and A.int_estado=1
order by dtt_FechaRegistro desc


end


GO





