CREATE procedure [app].[grl_contenedor_bus]
@wchr_contcargcodigo char(6)
as
begin

select 
	A.wchr_contcargcodigo,
	A.wchr_linea,
	A.wchr_serie_ctn,
	A.wchr_nro_ctn,
	A.wchr_tipo_ctn,
	A.wint_size_ctn,
	A.wchr_fec_operacion,
	A.wchr_est_fisi,
	A.wnum_tara,
	A.wnum_payload,
	A.wchr_cod_nave,
	A.wchr_nro_viaje,
	C.vch_numDoc as wint_nro_bk,
	A.wchr_cliente,
	A.wchr_tipo_movim,
	A.wnum_mon_total_erp,
	A.wchr_obse,
	A.wchr_puerto,
	A.wchr_depo,
	A.wchr_nro_eir,
	A.wchr_clase_ctn,
	isnull(B.wvch_contimgcod,'000000') as wvch_contimgcod
from grl_contenedor as A
left join grl_contenedorImagen as B on (A.wchr_contcargcodigo=B.wchr_contcargcodigo and B.wint_contst=1)
left join grl_documento as C on (A.wchr_contcargcodigo=C.wchr_contcargcodigo)
where A.wchr_contcargcodigo=@wchr_contcargcodigo

end

GO








