CREATE procedure [app].[grl_contenedor_lis]
@num varchar(255),
@ser varchar(255),
@des varchar(255)
as
begin

select A.wchr_contcargcodigo, A.wchr_linea, 	A.wchr_serie_ctn,	A.wchr_nro_ctn,	A.wchr_tipo_ctn,	A.wint_size_ctn,	A.wchr_fec_operacion,
A.wnum_tara,	A.wnum_payload,	A.wchr_cod_nave, isnull(B.wvch_contimgcod,'000000') as wvch_contimgcod,
C.vch_numDoc,
C.vch_UsuCorreo
from grl_contenedor as A
left join grl_contenedorImagen as B on (A.wchr_contcargcodigo=B.wchr_contcargcodigo and B.wint_contst=1)
inner join grl_documento as C on (A.wchr_contcargcodigo=C.wchr_contcargcodigo)
