CREATE procedure [app].[grl_vehiculo_ins]
@chr_EntiCodigoTransportista varchar(256),
@vch_VehiPlaca varchar(256),
@chr_ChofCodigo varchar(16),
@vch_UsuCorreo varchar(256)
as
begin

declare @chr_VehiCodigo char(6)
declare @id int
declare @id2 varchar(6)

set @chr_VehiCodigo='000000'

update grl_vehiculo set chr_VehiEstado='D' where vch_VehiPlaca=@vch_VehiPlaca and vch_UsuCorreo=@vch_UsuCorreo

set @chr_VehiCodigo=(select max(chr_VehiCodigo) from grl_vehiculo)

set @id=CONVERT(int,@chr_VehiCodigo)
set @id=@id+1
set @id2=CONVERT(varchar(6),@id)
set @chr_VehiCodigo=substring('00000'+@id2 , len(@id2),6) 


insert into grl_vehiculo(chr_VehiCodigo,	chr_EntiCodigoTransportista,	vch_VehiPlaca,	chr_ChofCodigo,	chr_VehiEstado,	dtt_RegistroCreado,	chr_UsuarioCreado, vch_UsuCorreo, chr_VehiTipoCodigo)
values(@chr_VehiCodigo,	@chr_EntiCodigoTransportista,	@vch_VehiPlaca,	@chr_ChofCodigo,	'H',	getdate(),	'5025', @vch_UsuCorreo,'00')


select top 50 
	A.chr_VehiCodigo, A.vch_VehiPlaca, A.chr_VehiEstado, 
	A.dtt_RegistroCreado, A.chr_VehiRegistroMTC,
	isnull(B.chr_codDocImg,'000000') as chr_codDocImg,
	A.vch_UsuCorreo,
	C.vch_ChofNombre,
	C.chr_ChofCodigo
from grl_vehiculo as A
left join grl_vehiculoPlaca as B on (A.chr_VehiCodigo=B.chr_VehiCodigo and B.bit_std=1)
inner join grl_Chofer as C on (A.chr_ChofCodigo=C.chr_ChofCodigo)
where A.chr_VehiCodigo=@chr_VehiCodigo

end


GO





