declare @m varchar(256)

update grl_usuarioApp set int_Estado=0 where vhr_usuMail=@vhr_usuMail

INSERT INTO [dbo].[grl_usuarioApp](
           [vhr_usuMail]
           ,[vhr_usuNick]
           ,[vhr_usuNombres]
           ,[vhr_usuApellidos]
           ,[vhr_usuDNI]
           ,[vhr_usuTelefono]
		   ,[vhr_usuPass]
           ,[dtt_fecReg]
           ,[chr_ClieCodigo]
           ,[vhr_mobModelo]
           ,[vhr_mobSerie]
           ,[vhr_mobCodigo]
           ,[vhr_mobSdk]
		   ,[vhr_token])
     VALUES
           (@vhr_usuMail,
           @vhr_usuNick,
           @vhr_usuNombres,
           @vhr_usuApellidos,
           @vhr_usuDNI, 
           @vhr_usuTelefono, 
		   @vhr_usuPass,
           @dtt_fecReg, 
           @chr_ClieCodigo,
           @vhr_mobModelo,
           @vhr_mobSerie,
           @vhr_mobCodigo,
           @vhr_mobSdk,
		   @vhr_token)



set @id=@@IDENTITY

set @m=CONVERT(varchar(64),@id)
set @m=substring('00000'+@m , len(@m),6) 

update grl_usuarioApp set chr_usuCod= @m where id=@id


select chr_usuCod
from grl_usuarioApp
where id=@id


end


GO







