CREATE  procedure [app].[veh_img_ins]
@chr_VehiCodigo char(6),
@bin_VehiImg varchar(max),
@chr_codDocImg char(6) output
as
begin


declare @id int
declare @id2 int
declare @m varchar(64)


insert into grl_vehiculoImagen(bin_VehiImg, int_VehiImgLen, chr_Estado, dtt_RegistroCreado, chr_UsuarioCreado)
values(@bin_VehiImg, len(@bin_VehiImg), 'H',getdate(),'5025')

set @id=@@IDENTITY

update grl_vehiculoPlaca set bit_std=0 where chr_VehiCodigo=@chr_VehiCodigo

