CREATE procedure [app].[veh_sel3]
@pla varchar(256),
@eml varchar(256)
as
begin

--select chr_VehiCodigo,  max(chr_codDocImg) as chr_codDocImg
--into #tmp01
--from grl_vehiculoPlaca
--where vch_VehiPlaca like '%'+@pla+'%' 
--group by chr_VehiCodigo


select top 50 
	A.chr_VehiCodigo, A.vch_VehiPlaca, A.chr_VehiEstado, 
	A.dtt_RegistroCreado, A.chr_VehiRegistroMTC,
	isnull(B.chr_codDocImg,'000000') as chr_codDocImg,
	A.vch_UsuCorreo,
	C.vch_ChofNombre,
	C.chr_ChofCodigo
from grl_vehiculo as A
left join grl_vehiculoPlaca as B on (A.chr_VehiCodigo=B.chr_VehiCodigo and B.bit_std=1)
inner join grl_Chofer as C on (A.chr_ChofCodigo=C.chr_ChofCodigo)
where (A.vch_VehiPlaca like '%'+@pla+'%') and (A.chr_VehiEstado='H') and (((@eml='')) or ((@eml!='') and (A.vch_UsuCorreo=@eml)))


end

GO






CREATE procedure [app].[veh_sel4]
@chr_VehiCodigo char(6)
as

begin

select 
	A.chr_VehiCodigo,
	A.vch_VehiPlaca,
	E.vch_VehiTipoDescripcion,
	isnull(F.chr_codDocImg,'000000') as chr_codDocImg,
	A.vch_VehiMarca,	
	A.chr_VehiRegistroMTC,
	G.chr_EjeNombre, 
	A.vch_UsuCorreo,
	A.dtt_RegistroCreado as dtt_RegistroCreado1,
	B.vch_ChofNombre, 
	B.vch_ChofBrevete,
	B.chr_ChofEstado,
	B.dtt_RegistroCreado as dtt_RegistroCreado2,
	F.chr_codDocImg,
	B.chr_ChofCodigo
from grl_Vehiculo as A
inner join grl_Chofer as B on (A.chr_ChofCodigo=B.chr_ChofCodigo)
inner join grl_Entidad as C on (A.chr_EntiCodigoTransportista=C.chr_EntiCodigo)
inner join grl_Cliente as D on (C.chr_ClieCodigo=D.chr_ClieCodigo)
left join grl_VehiculoTipo as E on (E.chr_VehiTipoCodigo=A.chr_VehiTipoCodigo)
left join grl_vehiculoPlaca as F on (A.chr_VehiCodigo=F.chr_VehiCodigo and F.bit_std=1)
left join grl_vehiculoEje as G on (A.chr_EjeCodigo=G.chr_EjeCodigo)
where A.chr_VehiCodigo=@chr_VehiCodigo



--select id, chr_codDocImg, dtt_RegistroCreado
--from grl_vehiculoPlaca
--where chr_VehiCodigo=@chr_VehiCodigo

end


GO








CREATE procedure [app].[veh_sel5]
@chr_ChofCodigo varchar(255),
@vch_UsuCorreo varchar(255)
as
begin

--select chr_VehiCodigo,  max(chr_codDocImg) as chr_codDocImg
--into #tmp01
--from grl_vehiculoPlaca
--where vch_VehiPlaca like '%'+@pla+'%' 
--group by chr_VehiCodigo


select top 50 
	A.chr_VehiCodigo, A.vch_VehiPlaca, A.chr_VehiEstado, 
	A.dtt_RegistroCreado, A.chr_VehiRegistroMTC,
	isnull(B.chr_codDocImg,'000000') as chr_codDocImg,
	A.vch_UsuCorreo,
	C.vch_ChofNombre,
	C.chr_ChofCodigo
from grl_vehiculo as A
left join grl_vehiculoPlaca as B on (A.chr_VehiCodigo=B.chr_VehiCodigo and B.bit_std=1)
inner join grl_Chofer as C on (A.chr_ChofCodigo=C.chr_ChofCodigo)
where C.chr_ChofCodigo=@chr_ChofCodigo
order by A.dtt_RegistroModifica desc

end

GO








CREATE procedure [app].[vis_get2]
@chr_ChofCodigo char(6),
@vch_UsuCorreo varchar(256)
as

begin


select 
	A.chr_ChofCodigo,
	isnull(A.chr_PersCodigo,'000000') as chr_PersCodigo,
	A.vch_ChofNombre, 
	A.vch_ChofBrevete,
	A.chr_ChofDNI,
	A.chr_ChofEstado,
	A.dtt_RegistroCreado as dtt_RegistroCreado2,
	B.chr_VehiCodigo,
	B.vch_VehiPlaca,
	E.vch_VehiTipoDescripcion,
	B.dtt_RegistroCreado as dtt_RegistroCreado1,
	D.vch_ClieSocial, 
	D.vch_ClieRuc, 
	D.vch_ClieDireccion,
	D.dtt_RegistroCreado as dtt_RegistroCreado3,
	A.vhr_ChofTelefono
from grl_chofer as A
left join grl_vehiculo as B on (A.chr_ChofCodigo =B.chr_ChofCodigo and A.vch_UsuCorreo=B.vch_UsuCorreo)
left join grl_Entidad as C on (B.chr_EntiCodigoTransportista=C.chr_EntiCodigo)
left join grl_Cliente as D on (C.chr_ClieCodigo=D.chr_ClieCodigo)
left join grl_VehiculoTipo as E on (E.chr_VehiTipoCodigo=B.chr_VehiTipoCodigo)
where A.chr_ChofCodigo=@chr_ChofCodigo
and A.chr_ChofEstado='H' and A.vch_UsuCorreo=@vch_UsuCorreo
order by A.dtt_RegistroModifica desc
end



GO






CREATE   procedure [app].[vis_img_ins]
@chr_ChofCodigo char(6),
@vch_UsuCorreo varchar(256),
@img_Foto varchar(max)
as
begin

declare @chr_PersCodigo char(6)
declare @id int
declare @id2 varchar(6)


set @chr_PersCodigo=(select max(chr_PersCodigo) from vis_PersonalFoto)

if(@chr_PersCodigo is NULL)
	set @chr_PersCodigo='000000'


set @id=CONVERT(int,@chr_PersCodigo)
set @id=@id+1
set @id2=CONVERT(varchar(6),@id)
set @chr_PersCodigo=substring('00000'+@id2 , len(@id2),6) 


insert into vis_PersonalFoto(chr_PersCodigo,	chr_PersFotoImg,	chr_UsuarioCreado,	dtt_RegistroCreado, img_Foto, int_Estado, vch_UsuCorreo) 
values(@chr_PersCodigo, '', '5025', getdate(), @img_Foto, 1, @vch_UsuCorreo)


update grl_chofer set chr_PersCodigo=@chr_PersCodigo where chr_ChofCodigo=@chr_ChofCodigo

select @chr_PersCodigo as chr_PersCodigo


end


GO







CREATE procedure [app].[vis_lis]
@nom varchar(256),
@usr varchar(256)
as
begin
select top 100 chr_ChofCodigo, chr_PersCodigo, vch_ChofNombre, vch_ChofBrevete,chr_ChofDNI,  chr_ChofEstado, dtt_RegistroCreado, chr_UsuarioCreado, vch_UsuCorreo,
vhr_ChofTelefono
from grl_chofer
where ((vch_ChofNombre like '%'+@nom+'%') or (chr_ChofDNI like '%'+@nom+'%')) and chr_ChofEstado='H' and ((@usr='') or ((@usr!='') and (vch_UsuCorreo=@usr)))
order by dtt_RegistroCreado desc

end

GO







CREATE procedure [app].[vis_updB]
@num int,
@ser varchar(256),
@des varchar(256),
@tip varchar(256),
@com varchar(256),
@rem varchar(256)
as
begin

if(@num=1)
	update grl_chofer set vhr_ChofTelefono=@ser, vch_UsuCorreo=@tip where chr_ChofCodigo=@des

if(@num=2)
	update grl_chofer set vch_ChofBrevete=@ser, vch_UsuCorreo=@tip where chr_ChofCodigo=@des

if(@num=3)
	update grl_vehiculo set chr_ChofCodigo=@des, vch_UsuCorreo=@tip where chr_VehiCodigo=@ser

if(@num=4)
	update grl_vehiculo set vch_VehiMarca=@des,dtt_RegistroModifica=getdate() where  chr_VehiCodigo=@ser

if(@num=5)
	update grl_vehiculo set chr_VehiTipoCodigo=@des,dtt_RegistroModifica=getdate() where  chr_VehiCodigo=@ser

if(@num=6)
	update grl_vehiculo set chr_VehiRegistroMTC=@des,dtt_RegistroModifica=getdate() where  chr_VehiCodigo=@ser

if(@num=7)
	update grl_vehiculo set chr_EjeCodigo=@des,dtt_RegistroModifica=getdate() where  chr_VehiCodigo=@ser

if(@num=8)
	update grl_vehiculo set chr_ChofCodigo=@des,dtt_RegistroModifica=getdate()  where  chr_VehiCodigo=@ser and vch_UsuCorreo=@tip and chr_EntiCodigoTransportista=@com

if(@num=9)
begin
	update grl_chofer set chr_ChofEstado=@des,dtt_RegistroModifica=getdate()  where  chr_ChofCodigo=@ser 
	update grl_cita set chr_ChofCodigo=null, vhr_ChofBrevete=NULL where chr_ChofCodigo=@ser and vhr_usuEmail=@tip
end


if(@num=10)
begin
	update grl_vehiculo set chr_VehiEstado=@des,dtt_RegistroModifica=getdate()  where  chr_VehiCodigo=@ser 
	update grl_cita set chr_VehiCodigo=null,vhr_vehiPlaca=NULL  where chr_VehiCodigo=@ser and vhr_usuEmail=@tip
end

if(@num=11)
	insert into grl_comentarios(vhr_usuCom, vhr_usuEmail) values(@ser, @tip)

end

GO





